import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <select>
        <option value="bebx">Bebx</option>
        <option value="pensa">Pensa</option>
        <option value="risa">Risa</option>
        <option value="quemado">Quemado</option>
        <option value="enojada"> Enojada</option>
      </select>
      <br />
      <input type="text" placeholder="Opcion 1"/>
      <br />
      <input type="text" placeholder="Opcion 2"/>
      <br />
      <button>Exportar</button>
    </div>
  );
}

export default App;
